import React from 'react'
import Announcements from './Announcements'
import Pagination from './Pagination'

export default function Announcement() {
    return (
        <div className="announcement">
            <div className="announcement-top">
                <Announcements />
                <Pagination />
            </div>
        </div>
    )
}
